namespace Relativity.DataExchange.Import.NUnit.Integration
{
	using System.Diagnostics.CodeAnalysis;
	using System.Linq;
	using System.Text;
	using System.Threading.Tasks;
	using global::NUnit.Framework;

	using kCura.Relativity.Client.DTOs;
	using kCura.Relativity.DataReaderClient;

	using Relativity.DataExchange.Import.NUnit.Integration.Dto;
	using Relativity.DataExchange.TestFramework;
	using Relativity.DataExchange.TestFramework.Import.JobExecutionContext;
	using Relativity.DataExchange.TestFramework.NUnitExtensions;
	using Relativity.DataExchange.TestFramework.RelativityHelpers;
	using Relativity.DataExchange.TestFramework.RelativityVersions;
	using Relativity.Services.Field.Models;
	using Relativity.Services.Interfaces.Field.Models;
	using Relativity.Services.Interfaces.Shared.Models;
	using Relativity.Services.LinkManager.Interfaces;
	using Relativity.Testing.Identification;

	[TestFixture]
	[Feature.DataTransfer.ImportApi.Operations.ImportDocuments]
	public class RelationalFieldsTests : ImportJobTestBase<NativeImportExecutionContext>
	{
		private const RelativityVersion MinSupportedVersion = RelativityVersion.Foxglove;

		private const string IconBase64 = "";

		private readonly DocumentWithRelationalFieldDto[] initialData =
			{
				new DocumentWithRelationalFieldDto("10001", "AAA", "REL1"),
				new DocumentWithRelationalFieldDto("10002", "BBB", "REL2"),
				new DocumentWithRelationalFieldDto("10003", "CCC", "REL3"),
				new DocumentWithRelationalFieldDto("10004", "DDD", "REL4"),
			};

		private bool testsSkipped = false;

		private int keyFieldId;
		private int relationalFieldId;

		[OneTimeSetUp]
		public async Task SetupObjectAsync()
		{
			testsSkipped = RelativityVersionChecker.VersionIsLowerThan(
				this.TestParameters,
				MinSupportedVersion);
			if (!this.testsSkipped)
			{
				await RdoHelper.DeleteAllObjectsByTypeAsync(this.TestParameters, (int)ArtifactType.Document).ConfigureAwait(false); // Remove all Documents imported in AssemblySetup

				await Task.WhenAll(
						this.CreateKeyFieldAsync().ContinueWith(task => this.keyFieldId = task.Result),
						this.CreateRelationalFieldAsync().ContinueWith(task => this.relationalFieldId = task.Result)).ConfigureAwait(false);
			}
		}

		[TearDown]
		public async Task TearDown()
		{
			if (!testsSkipped)
			{
				await RdoHelper.DeleteAllObjectsByTypeAsync(this.TestParameters, (int)ArtifactTypeID.Document).ConfigureAwait(false);
			}
		}

		[OneTimeTearDown]
		public async Task OneTimeTearDown()
		{
			if (!this.testsSkipped)
			{
				await Task.WhenAll(
						TestFramework.RelativityHelpers.FieldHelper.DeleteFieldAsync(this.TestParameters, this.keyFieldId),
						TestFramework.RelativityHelpers.FieldHelper.DeleteFieldAsync(this.TestParameters, this.relationalFieldId))
					.ConfigureAwait(false);
			}
		}

		[Category(TestCategories.ImportDoc)]
		[Category(TestCategories.Integration)]
		[IgnoreIfVersionLowerThan(MinSupportedVersion)]
		[IdentifiedTest("bb8a9d7a-78b1-42a8-b25a-776f6214e283")]
		public void ShouldReplaceBlankValuesWithIdentifier([Values(OverwriteModeEnum.Append, OverwriteModeEnum.Overlay)] OverwriteModeEnum overwriteMode)
		{
			// ARRANGE
			Settings settings = NativeImportSettingsProvider.GetDefaultSettings();

			if (overwriteMode == OverwriteModeEnum.Overlay)
			{
				this.JobExecutionContext.InitializeImportApiWithUserAndPassword(this.TestParameters, settings);
				this.JobExecutionContext.Execute(this.initialData);
				settings.OverwriteMode = OverwriteModeEnum.Overlay;
			}

			DocumentWithRelationalFieldDto[] importData =
				{
					new DocumentWithRelationalFieldDto("10001", "AAA", "REL11"),
					new DocumentWithRelationalFieldDto("10002", "BBB", "REL12"),
					new DocumentWithRelationalFieldDto("10003", "CCC", string.Empty),
					new DocumentWithRelationalFieldDto("10004", "DDD", null),
				};

			DocumentWithRelationalFieldDto[] expectedData =
				{
					new DocumentWithRelationalFieldDto("10001", "AAA", "REL11"),
					new DocumentWithRelationalFieldDto("10002", "BBB", "REL12"),
					new DocumentWithRelationalFieldDto("10003", "CCC", "10003"),
					new DocumentWithRelationalFieldDto("10004", "DDD", "10004"),
				};

			this.JobExecutionContext.InitializeImportApiWithUserAndPassword(this.TestParameters, settings);

			// ACT
			ImportTestJobResult results = this.JobExecutionContext.Execute(importData);

			// ASSERT
			this.ThenTheImportJobIsSuccessful(results, importData?.Length ?? 0);
			this.ThenExpectedDataAreImported(expectedData);
		}

		[Category(TestCategories.ImportDoc)]
		[Category(TestCategories.Integration)]
		[IgnoreIfVersionLowerThan(MinSupportedVersion)]
		[IdentifiedTest("7ec1962f-54ed-41cd-bd0c-94c4e23c39df")]
		public void ShouldReplaceBlankValuesWithIdentifierWhenRelationalFieldIsNotMappedInAppendMode()
		{
			// ARRANGE
			Settings settings = NativeImportSettingsProvider.GetDefaultSettings();

			DocumentWithKeyFieldDto[] importData =
				{
					new DocumentWithKeyFieldDto("10001", "AAA"),
					new DocumentWithKeyFieldDto("10002", "BBB"),
					new DocumentWithKeyFieldDto("10003", "CCC"),
					new DocumentWithKeyFieldDto("10004", "DDD"),
				};

			DocumentWithRelationalFieldDto[] expectedData =
				{
					new DocumentWithRelationalFieldDto("10001", "AAA", "10001"),
					new DocumentWithRelationalFieldDto("10002", "BBB", "10002"),
					new DocumentWithRelationalFieldDto("10003", "CCC", "10003"),
					new DocumentWithRelationalFieldDto("10004", "DDD", "10004"),
				};

			this.JobExecutionContext.InitializeImportApiWithUserAndPassword(this.TestParameters, settings);

			// ACT
			ImportTestJobResult results = this.JobExecutionContext.Execute(importData);

			// ASSERT
			this.ThenTheImportJobIsSuccessful(results, importData?.Length ?? 0);
			this.ThenExpectedDataAreImported(expectedData);
		}

		[Category(TestCategories.ImportDoc)]
		[Category(TestCategories.Integration)]
		[IgnoreIfVersionLowerThan(MinSupportedVersion)]
		[IdentifiedTest("7ec1962f-54ed-41cd-bd0c-94c4e23c39df")]
		public void ShouldNotReplaceBlankValuesWithIdentifierWhenRelationalFieldIsNotMappedInOverlayMode()
		{
			// ARRANGE
			Settings settings = NativeImportSettingsProvider.GetDefaultSettings();
			this.JobExecutionContext.InitializeImportApiWithUserAndPassword(this.TestParameters, settings);
			this.JobExecutionContext.Execute(this.initialData);

			DocumentWithKeyFieldDto[] importData =
				{
					new DocumentWithKeyFieldDto("10001", "AAA"),
					new DocumentWithKeyFieldDto("10002", "BBB"),
					new DocumentWithKeyFieldDto("10003", "CCC"),
					new DocumentWithKeyFieldDto("10004", "DDD"),
				};

			DocumentWithRelationalFieldDto[] expectedData =
				{
					new DocumentWithRelationalFieldDto("10001", "AAA", "REL1"),
					new DocumentWithRelationalFieldDto("10002", "BBB", "REL2"),
					new DocumentWithRelationalFieldDto("10003", "CCC", "REL3"),
					new DocumentWithRelationalFieldDto("10004", "DDD", "REL4"),
				};

			settings.OverwriteMode = OverwriteModeEnum.Overlay;
			this.JobExecutionContext.InitializeImportApiWithUserAndPassword(this.TestParameters, settings);

			// ACT
			ImportTestJobResult results = this.JobExecutionContext.Execute(importData);

			// ASSERT
			this.ThenTheImportJobIsSuccessful(results, importData?.Length ?? 0);
			this.ThenExpectedDataAreImported(expectedData);
		}

		[Category(TestCategories.ImportDoc)]
		[Category(TestCategories.Integration)]
		[IgnoreIfVersionLowerThan(MinSupportedVersion)]
		[IdentifiedTest("6ad353b2-fe61-4d14-8a04-349ad8f3ef63")]
		public void ShouldReplaceBlankValuesWithIdentifierWhenIdentifierIsNotMapped()
		{
			// ARRANGE
			Settings settings = NativeImportSettingsProvider.GetDefaultSettings();
			this.JobExecutionContext.InitializeImportApiWithUserAndPassword(this.TestParameters, settings);
			this.JobExecutionContext.Execute(this.initialData);

			DocumentWithRelationalFieldWithoutIdentifierDto[] importData =
				{
					new DocumentWithRelationalFieldWithoutIdentifierDto("AAA", "REL10"),
					new DocumentWithRelationalFieldWithoutIdentifierDto("BBB", "REL11"),
					new DocumentWithRelationalFieldWithoutIdentifierDto("CCC", string.Empty),
					new DocumentWithRelationalFieldWithoutIdentifierDto("DDD", null),
				};

			DocumentWithRelationalFieldDto[] expectedData =
				{
					new DocumentWithRelationalFieldDto("10001", "AAA", "REL10"),
					new DocumentWithRelationalFieldDto("10002", "BBB", "REL11"),
					new DocumentWithRelationalFieldDto("10003", "CCC", "CCC"),
					new DocumentWithRelationalFieldDto("10004", "DDD", "DDD"),
				};

			settings.OverwriteMode = OverwriteModeEnum.Overlay;
			settings.IdentityFieldId = this.keyFieldId;
			this.JobExecutionContext.InitializeImportApiWithUserAndPassword(this.TestParameters, settings);

			// ACT
			ImportTestJobResult results = this.JobExecutionContext.Execute(importData);

			// ASSERT
			this.ThenTheImportJobIsSuccessful(results, importData?.Length ?? 0);
			this.ThenExpectedDataAreImported(expectedData);
		}

		private void ThenExpectedDataAreImported(DocumentWithRelationalFieldDto[] expectedData)
		{
			string[] fieldsToValidate = new[] { WellKnownFields.ControlNumber, WellKnownFields.KeyFieldName, WellKnownFields.RelationalFieldName };
			DocumentWithRelationalFieldDto[] resultData = RdoHelper.QueryRelativityObjects(this.TestParameters, (int)ArtifactTypeID.Document, fieldsToValidate)
				.Select(ro => new DocumentWithRelationalFieldDto((string)ro.FieldValues[0].Value, (string)ro.FieldValues[1].Value, (string)ro.FieldValues[2].Value))
				.ToArray();

			CollectionAssert.AreEquivalent(expectedData.Select(d => d.ToString()), resultData.Select(d => d.ToString()));
		}

		private Task<int> CreateRelationalFieldAsync()
		{
			if (RelativityVersionChecker.VersionIsLowerThan(this.TestParameters, RelativityVersion.Goatsbeard))
			{
				Field field = new Field
				{
					AllowGroupBy = false,
					AllowPivot = false,
					AllowSortTally = false,
					Length = 50,
					Unicode = true,
					FieldTypeID = kCura.Relativity.Client.FieldType.FixedLengthText,
					IgnoreWarnings = true,
					IsRequired = false,
					Linked = false,
					Name = WellKnownFields.RelationalFieldName,
					OpenToAssociations = false,
					Width = "12",
					Wrapping = false,
					IsRelational = true,
					PaneIcon = new RelationalFieldIcon("chart_organization.png", Encoding.Unicode.GetBytes(IconBase64)),
					FriendlyName = "FriendlyName",
					Order = 1,
					IncludeInTextIndex = false,
					AllowHTML = false,
					ImportBehavior = kCura.Relativity.Client.ImportBehavior.ReplaceBlankValuesWithIdentifier,
					RelationalView = new View(0),
				};

				return Task.FromResult(FieldHelper.CreateField(
					this.TestParameters,
					(int)ArtifactTypeID.Document,
					field));
			}
			else
			{
				var request = new FixedLengthFieldRequest()
				{
					Name = WellKnownFields.RelationalFieldName,
					ObjectType = new ObjectTypeIdentifier { ArtifactTypeID = (int)ArtifactTypeID.Document },
					OpenToAssociations = false,
					HasUnicode = true,
					Length = 50,
					IsRelational = true,
					FriendlyName = "FriendlyName",
					ImportBehavior = ImportBehavior.ReplaceBlankValuesWithIdentifier,
					PaneIcon = new PaneIcon() { FileName = "chart_organization.png", ImageBase64 = IconBase64 },
					Order = 1,
				};

				return FieldHelper.CreateFieldAsync(this.TestParameters, request);
			}
		}

		private async Task<int> CreateKeyFieldAsync()
		{
			return await TestFramework.RelativityHelpers.FieldHelper.CreateFixedLengthTextFieldAsync(
					this.TestParameters,
					(int)ArtifactTypeID.Document,
					WellKnownFields.KeyFieldName,
					false,
					length: 50)
				.ConfigureAwait(false);
		}

		private class DocumentWithRelationalFieldDto
		{
			public DocumentWithRelationalFieldDto(string controlNumber, string keyField, string relationalField)
			{
				this.ControlNumber = controlNumber;
				this.KeyField = keyField;
				this.RelationalField = relationalField;
			}

			[SuppressMessage("Microsoft.Performance", "CA1811:AvoidUncalledPrivateCode", Justification = "Must be public for DataReader")]
			[System.ComponentModel.DisplayName(WellKnownFields.ControlNumber)]
			public string ControlNumber { get; }

			[SuppressMessage("Microsoft.Performance", "CA1811:AvoidUncalledPrivateCode", Justification = "Must be public for DataReader")]
			[System.ComponentModel.DisplayName(WellKnownFields.KeyFieldName)]
			public string KeyField { get; }

			[SuppressMessage("Microsoft.Performance", "CA1811:AvoidUncalledPrivateCode", Justification = "Must be public for DataReader")]
			[System.ComponentModel.DisplayName(WellKnownFields.RelationalFieldName)]
			public string RelationalField { get; }

			public override string ToString()
			{
				return $"{ControlNumber}_{KeyField}_{RelationalField}";
			}
		}

		private class DocumentWithRelationalFieldWithoutIdentifierDto
		{
			public DocumentWithRelationalFieldWithoutIdentifierDto(string keyField, string relationalField)
			{
				this.KeyField = keyField;
				this.RelationalField = relationalField;
			}

			[SuppressMessage("Microsoft.Performance", "CA1811:AvoidUncalledPrivateCode", Justification = "Must be public for DataReader")]
			[System.ComponentModel.DisplayName(WellKnownFields.KeyFieldName)]
			public string KeyField { get; }

			[SuppressMessage("Microsoft.Performance", "CA1811:AvoidUncalledPrivateCode", Justification = "Must be public for DataReader")]
			[System.ComponentModel.DisplayName(WellKnownFields.RelationalFieldName)]
			public string RelationalField { get; }
		}
	}
}